Rendering Pages
    ================

    SIMPLE TEXT
    --------------
    To put simple text or HTML to a screen:

        res.render( { body_text: 'Hello <b>world</b>' } );


    TEMPLATE
    ---------
    To put a specific template (like a form) with variables:

        res.render( 'box/form.html', { username: name, phone: phone } );

    STATUS MESSAGES
    -----------------
    To ouput specific status messages:

        var page = safeharbor.page;

        res.outputMessage( page.MESSAGE_LEVELS.warning,
                           'Warning Title',
                           'Some warning text goes here' );

     You can have multiple of these output message on the same page. Later,
     you can then call res.render() as above. This allows for the following
     scenario:

            if( onSubmit && (some_error == true) ) 
            {
                // on submit there was some error
                res.outputMessage( page.MESSAGE_LEVELS.error,
                                   'Try again',
                                   'Some error text goes here' );
            }

            // on first time render OR error re-submit:

            res.render( 'box/form.html', postargs );

STATUS (ONLY) PAGES
    ---------------------
    If all you want to output is the message (no template):

            res.outputMessage( page.MESSAGE_LEVELS.success,
                               'Wonderful',
                               'Some happy text goes here' );

            res.render( page.MESSAGE_VIEW, { pageTitle: 'Happy Joy' } );

    AJAX-STYLE HTML SNIPPETS
    --------------------------
    To return a snippet of HTML (either as 'body_text', message or template) use 
    the same techniques as above but the layout option:

            res.render( { layout: page.SNIPPET, 
                          body_text: 'This text is for embedding' } );

    Also works for templates:

            res.render( 'profile/acct_email.html', // <-- template for embedded editing
                         { layout: page.SNIPPET } )

Basic Auth:

Enfore basic authentication by providing a `callback(user, pass)`,
which must return `true` in order to gain access. Alternatively an async
method is provided as well, invoking `callback(user, pass, callback)`. Populates
`req.user`. The final alternative is simply passing username / password
strings.

 Simple username and password

    connect(connect.basicAuth('username', 'password'));

 Callback verification

    connect()
      .use(connect.basicAuth(function(user, pass){
        return 'tj' == user & 'wahoo' == pass;
      }))

 Async callback verification, accepting `fn(err, user)`.

    connect()
      .use(connect.basicAuth(function(user, pass, fn){
        User.authenticate({ user: user, pass: pass }, fn);
      }))

Body parser:

  Parse request bodies, supports _application/json_,
  _application/x-www-form-urlencoded_, and _multipart/form-data_.

  This is equivalent to: 

    app.use(connect.json());
    app.use(connect.urlencoded());
    app.use(connect.multipart());

Examples:

     connect()
       .use(connect.bodyParser())
       .use(function(req, res) {
         res.end('viewing user ' + req.body.user.name);
       });

     $ curl -d 'user[name]=tj' http://local/
     $ curl -d '{"user":{"name":"tj"}}' -H "Content-Type: application/json" http://local/

 View [json](json.html), [urlencoded](urlencoded.html), and [multipart](multipart.html) for more info.

Cookie Session:

  Cookie session middleware.

     var app = connect();
     app.use(connect.cookieParser('tobo!'));
     app.use(connect.cookieSession({ cookie: { maxAge: 60 * 60 * 1000 }}));

Options:

  - `key` cookie name defaulting to `connect.sess`
  - `cookie` session cookie settings, defaulting to `{ path: '/', httpOnly: true, maxAge: null }`
  - `proxy` trust the reverse proxy when setting secure cookies (via "x-forwarded-proto")

Clearing sessions:

 To clear the session simply set its value to `null`,
 `cookieSession()` will then respond with a 1970 Set-Cookie.

    req.session = null;

Query:

Automatically parse the query-string when available,
populating the `req.query` object.

Examples:

    connect()
      .use(connect.query())
      .use(function(req, res){
        res.end(JSON.stringify(req.query));
      });

 The `options` passed are provided to qs.parse function.

Session:

  Setup session store with the given `options`.

  Session data is _not_ saved in the cookie itself, however
  cookies are used, so we must use the [cookieParser()](cookieParser.html)
  middleware _before_ `session()`.

Examples:

    connect()
      .use(connect.cookieParser('keyboard cat'))
      .use(connect.session({ key: 'sid', cookie: { secure: true }}))

Options:

  - `key` cookie name defaulting to `connect.sid`
  - `store` session store instance
  - `cookie` session cookie settings, defaulting to `{ path: '/', httpOnly: true, maxAge: null }`
  - `proxy` trust the reverse proxy when setting secure cookies (via "x-forwarded-proto")

Cookie option:

 By default `cookie.maxAge` is `null`, meaning no "expires" parameter is set
 so the cookie becomes a browser-session cookie. When the user closes the 
 browser the cookie (and session) will be removed.

## req.session

 To store or access session data, simply use the request property `req.session`,
 which is (generally) serialized as JSON by the store, so nested objects 
 are typically fine. For example below is a user-specific view counter:

      connect()
        .use(connect.favicon())
        .use(connect.cookieParser('keyboard cat'))
        .use(connect.session({ cookie: { maxAge: 60000 }}))
        .use(function(req, res, next){
          var sess = req.session;
          if (sess.views) {
            res.setHeader('Content-Type', 'text/html');
            res.write('<p>views: ' + sess.views + '</p>');
            res.write('<p>expires in: ' + (sess.cookie.maxAge / 1000) + 's</p>');
            res.end();
            sess.views++;
          } else {
            sess.views = 1;
            res.end('welcome to the session demo. refresh!');
          }
        }
      )).listen(3000);

## Session#regenerate()

 To regenerate the session simply invoke the method, once complete
 a new SID and `Session` instance will be initialized at `req.session`.

     req.session.regenerate(function(err){
       // will have a new session here
     });

## Session#destroy()

 Destroys the session, removing `req.session`, will be re-generated next request.

     req.session.destroy(function(err){
       // cannot access session here
     });

## Session#reload()

 Reloads the session data.

     req.session.reload(function(err){
       // session updated
     });

## Session#save()

 Save the session.

     req.session.save(function(err){
       // session saved
     });

## Session#touch()

  Updates the `.maxAge` property. Typically this is
  not necessary to call, as the session middleware does this for you.

## Session#cookie

 Each session has a unique cookie object accompany it. This allows
 you to alter the session cookie per visitor. For example we can
 set `req.session.cookie.expires` to `false` to enable the cookie
 to remain for only the duration of the user-agent.

## Session#maxAge

 Alternatively `req.session.cookie.maxAge` will return the time
 remaining in milliseconds, which we may also re-assign a new value
 to adjust the `.expires` property appropriately. The following
 are essentially equivalent

    var hour = 3600000;
    req.session.cookie.expires = new Date(Date.now() + hour);
    req.session.cookie.maxAge = hour;

For example when `maxAge` is set to `60000` (one minute), and 30 seconds
has elapsed it will return `30000` until the current request has completed,
at which time `req.session.touch()` is called to reset `req.session.maxAge`
to its original value.

    req.session.cookie.maxAge;
    // => 30000

Session Store Implementation:

Every session store _must_ implement the following methods

   - `.get(sid, callback)`
   - `.set(sid, session, callback)`
   - `.destroy(sid, callback)`

Recommended methods include, but are not limited to:

   - `.length(callback)`
   - `.clear(callback)`

For an example implementation view the [connect-redis](http://github.com/visionmedia/connect-redis) repo.

Listen for connections.

This method takes the same arguments
as node's `http.Server#listen()`.  

HTTP and HTTPS:

If you run your application both as HTTP
and HTTPS you may wrap them individually,
since your Connect "server" is really just
a JavaScript `Function`.

     var connect = require('connect')
       , http = require('http')
       , https = require('https');

     var app = connect();

     http.createServer(app).listen(80);
     https.createServer(options, app).listen(443);

Return md5 hash of the given string and optional encoding,
defaulting to hex.

    utils.md5('wahoo');
    // => "e493298061761236c96b02ea6aa8a2ad"

Merge object b with object a.

    var a = { foo: 'bar' }
      , b = { bar: 'baz' };

    utils.merge(a, b);
    // => { foo: 'bar', bar: 'baz' }

Return a unique identifier with the given `len`.

    utils.uid(10);
    // => "FDaS435D2z"

Serialize the given object into a cookie string.

     utils.serializeCookie('name', 'tj', { httpOnly: true })
     // => "name=tj; httpOnly"

Pause `data` and `end` events on the given `obj`.
Middleware performing async tasks _should_ utilize
this utility (or similar), to re-emit data once
the async operation has completed, otherwise these
events may be lost.

     var pause = utils.pause(req);
     fs.readFile(path, function(){
        next();
        pause.resume();
     });

Provides a http request, response testing environment.

Example:

 var httputil = require('nodeunit').utils.httputil
 exports.testSomething = function(test) {
   httputil(function (req, resp) {
       resp.writeHead(200, {});
       resp.end('test data');
     },
     function(server, client) {
       client.fetch('GET', '/', {}, function(resp) {
         test.equal('test data', resp.body);
         server.close();
         test.done();
       })
     });
 };

Assign a callback `fn` which is called
when this `Server` is passed to `Server#use()`.

Examples:

   var app = express.createServer()
     , blog = express.createServer();

   blog.mounted(function(parent){
     // parent is app
     // "this" is blog
   });

   app.use(blog);

Map the given param placeholder `name`(s) to the given callback(s).

Param mapping is used to provide pre-conditions to routes
which us normalized placeholders. This callback has the same
signature as regular middleware, for example below when ":userId"
is used this function will be invoked in an attempt to load the user.

     app.param('userId', function(req, res, next, id){
       User.find(id, function(err, user){
         if (err) {
           next(err);
         } else if (user) {
           req.user = user;
           next();
         } else {
           next(new Error('failed to load user'));
         }
       });
     });

Passing a single function allows you to map logic
to the values passed to `app.param()`, for example
this is useful to provide coercion support in a concise manner.

The following example maps regular expressions to param values
ensuring that they match, otherwise passing control to the next
route:

     app.param(function(name, regexp){
       if (regexp instanceof RegExp) {
         return function(req, res, next, val){
           var captures;
           if (captures = regexp.exec(String(val))) {
             req.params[name] = captures;
             next();
           } else {
             next('route');
           }
         }
       }
     });

We can now use it as shown below, where "/commit/:commit" expects
that the value for ":commit" is at 5 or more digits. The capture
groups are then available as `req.params.commit` as we defined
in the function above.

   app.param('commit', /^\d{5,}$/);

For more of this useful functionality take a look
at [express-params](http://github.com/visionmedia/express-params).

Configure callback for zero or more envs,
when no env is specified that callback will
be invoked for all environments. Any combination
can be used multiple times, in any order desired.

Examples:

   app.configure(function(){
     // executed for all envs
   });

   app.configure('stage', function(){
     // executed staging env
   });

   app.configure('stage', 'production', function(){
     // executed for stage and production
   });

Return request header or optional default.

The `Referrer` header field is special-cased,
both `Referrer` and `Referer` will yield are
interchangeable.

Examples:

    req.header('Content-Type');
    // => "text/plain"

    req.header('content-type');
    // => "text/plain"

    req.header('Accept');
    // => undefined

    req.header('Accept', 'text/html');
    // => "text/html"

Get `field`'s `param` value, defaulting to ''.

Examples:

    req.get('content-disposition', 'filename');
    // => "something.png"

Check if the _Accept_ header is present, and includes the given `type`.

When the _Accept_ header is not present `true` is returned. Otherwise
the given `type` is matched by an exact match, and then subtypes. You
may pass the subtype such as "html" which is then converted internally
to "text/html" using the mime lookup table.

Examples:

    // Accept: text/html
    req.accepts('html');
    // => true

    // Accept: text/*; application/json
    req.accepts('html');
    req.accepts('text/html');
    req.accepts('text/plain');
    req.accepts('application/json');
    // => true

    req.accepts('image/png');
    req.accepts('png');
    // => false

Queue flash `msg` of the given `type`.

Examples:

     req.flash('info', 'email sent');
     req.flash('error', 'email delivery failed');
     req.flash('info', 'email re-sent');
     // => 2

     req.flash('info');
     // => ['email sent', 'email re-sent']

     req.flash('info');
     // => []

     req.flash();
     // => { error: ['email delivery failed'], info: [] }

Formatting:

Flash notifications also support arbitrary formatting support.
For example you may pass variable arguments to `req.flash()`
and use the %s specifier to be replaced by the associated argument:

    req.flash('info', 'email has been sent to %s.', userName);

To add custom formatters use the `exports.flashFormatters` object.

Check if the incoming request contains the "Content-Type" 
header field, and it contains the give mime `type`.

Examples:

     // With Content-Type: text/html; charset=utf-8
     req.is('html');
     req.is('text/html');
     // => true

     // When Content-Type is application/json
     req.is('json');
     req.is('application/json');
     // => true

     req.is('html');
     // => false

Ad-hoc callbacks can also be registered with Express, to perform
assertions again the request, for example if we need an expressive
way to check if our incoming request is an image, we can register "an image"
callback:

      app.is('an image', function(req){
        return 0 == req.headers['content-type'].indexOf('image');
      });

 Now within our route callbacks, we can use to to assert content types
 such as "image/jpeg", "image/png", etc.

     app.post('/image/upload', function(req, res, next){
       if (req.is('an image')) {
         // do something
       } else {
         next();
       }
     });

Send a response with the given `body` and optional `headers` and `status` code.

Examples:

    res.send();
    res.send(new Buffer('wahoo'));
    res.send({ some: 'json' });
    res.send('<p>some html</p>');
    res.send('Sorry, cant find that', 404);
    res.send('text', { 'Content-Type': 'text/plain' }, 201);
    res.send(404);

Send JSON response with `obj`, optional `headers`, and optional `status`.

Examples:

    res.json(null);
    res.json({ user: 'tj' });
    res.json('oh noes!', 500);
    res.json('I dont have that', 404);

Set _Content-Type_ response header passed through `mime.lookup()`.

Examples:

    var filename = 'path/to/image.png';
    res.contentType(filename);
    // res.headers['Content-Type'] is now "image/png"

    res.contentType('.html');
    res.contentType('html');
    res.contentType('json');
    res.contentType('png');

Set cookie `name` to `val`, with the given `options`.

Options:

   - `maxAge`   max-age in milliseconds, converted to `expires`
   - `path`     defaults to the "basepath" setting which is typically "/"

Examples:

   // "Remember Me" for 15 minutes
   res.cookie('rememberme', '1', { expires: new Date(Date.now() + 900000), httpOnly: true });

   // save as above
   res.cookie('rememberme', '1', { maxAge: 900000, httpOnly: true })

Redirect to the given `url` with optional response `status`
defauling to 302.

The given `url` can also be the name of a mapped url, for
example by default express supports "back" which redirects
to the _Referrer_ or _Referer_ headers or the application's
"basepath" setting. Express also supports "basepath" out of the box,
which can be set via `app.set('basepath', '/blog');`, and defaults
to '/'.

Redirect Mapping:

 To extend the redirect mapping capabilities that Express provides,
 we may use the `app.redirect()` method:

    app.redirect('google', 'http://google.com');

 Now in a route we may call:

    res.redirect('google');

 We may also map dynamic redirects:

     app.redirect('comments', function(req, res){
         return '/post/' + req.params.id + '/comments';
     });

 So now we may do the following, and the redirect will dynamically adjust to
 the context of the request. If we called this route with _GET /post/12_ our
 redirect _Location_ would be _/post/12/comments_.

     app.get('/post/:id', function(req, res){
       res.redirect('comments');
     });

 Unless an absolute `url` is given, the app's mount-point
 will be respected. For example if we redirect to `/posts`,
 and our app is mounted at `/blog` we will redirect to `/blog/posts`.

Enfore basic authentication by providing a `callback(user, pass)`,
which must return `true` in order to gain access. Alternatively an async
method is provided as well, invoking `callback(user, pass, callback)`. Populates
`req.remoteUser`. The final alternative is simply passing username / password
strings.

Examples:

    connect(connect.basicAuth('username', 'password'));

    connect(
      connect.basicAuth(function(user, pass){
        return 'tj' == user & 'wahoo' == pass;
      })
    );

    connect(
      connect.basicAuth(function(user, pass, fn){
        User.authenticate({ user: user, pass: pass }, fn);
      })
    );

Parse _Cookie_ header and populate `req.cookies`
with an object keyed by the cookie names.

Examples:

    connect.createServer(
        connect.cookieParser()
      , function(req, res, next){
        res.end(JSON.stringify(req.cookies));
      }
    );

CRSF protection middleware.

By default this middleware generates a token named "_csrf"
which should be added to requests which mutate
state, within a hidden form field, query-string etc. This
token is validated against the visitor's `req.session._csrf`
property which is re-generated per request.

The default `value` function checks `req.body` generated
by the `bodyParser()` middleware, `req.query` generated
by `query()`, and the "X-CSRF-Token" header field.

This middleware requires session support, thus should be added
somewhere _below_ `session()` and `cookieParser()`.

Examples:

     var form = '\n\
       <form action="/" method="post">\n\
         <input type="hidden" name="_csrf" value="{token}" />\n\
         <input type="text" name="user[name]" value="{user}" />\n\
         <input type="password" name="user[pass]" />\n\
         <input type="submit" value="Login" />\n\
       </form>\n\
     '; 

     connect(
         connect.cookieParser()
       , connect.session({ secret: 'keyboard cat' })
       , connect.bodyParser()
       , connect.csrf()

       , function(req, res, next){
         if ('POST' != req.method) return next();
         req.session.user = req.body.user;
         next();
       }

       , function(req, res){
         res.setHeader('Content-Type', 'text/html');
         var body = form
           .replace('{token}', req.session._csrf)
           .replace('{user}', req.session.user && req.session.user.name || '');
         res.end(body);
       }
     ).listen(3000);

Options:

   - `value` a function accepting the request, returning the token

By default serves the connect favicon, or the favicon
located by the given `path`.

Options:

  - `maxAge`  cache-control max-age directive, defaulting to 1 day

Examples:

    connect.createServer(
      connect.favicon()    
    );

    connect.createServer(
      connect.favicon(__dirname + '/public/favicon.ico')    
    );

Limit request bodies to the given size in `bytes`.

A string representation of the bytesize may also be passed,
for example "5mb", "200kb", "1gb", etc.

Examples:

    var server = connect(
      connect.limit('5.5mb')
    ).listen(3000);

Automatically parse the query-string when available,
populating the `req.query` object.

Examples:

    connect(
        connect.query()
      , function(req, res){
        res.end(JSON.stringify(req.query));
      }
    ).listen(3000);

Provides Sinatra and Express-like routing capabilities.

Examples:

    connect.router(function(app){
      app.get('/user/:id', function(req, res, next){
        // populates req.params.id
      });
      app.put('/user/:id', function(req, res, next){
        // populates req.params.id
      });
    })

Setup session store with the given `options`.

Session data is _not_ saved in the cookie itself, however
cookies are used, so we must use the [cookieParser()](middleware-cookieParser.html)
middleware _before_ `session()`.

Examples:

    connect.createServer(
        connect.cookieParser()
      , connect.session({ secret: 'keyboard cat' })
    );

Options:

  - `key`           cookie name defaulting to `connect.sid`
  - `store`         Session store instance
  - `fingerprint`   Custom fingerprint generating function
  - `cookie`        Session cookie settings, defaulting to `{ path: '/', httpOnly: true, maxAge: 14400000 }`
  - `secret`        Secret string used to compute hash

Ignore Paths:

 By default `/favicon.ico` is the only ignored path, all others
 will utilize sessions, to manipulate the paths ignored, use
`connect.session.ignore.push('/my/path')`. This works for _full_
 pathnames only, not segments nor substrings.

    connect.session.ignore.push('/robots.txt');

## req.session

 To store or access session data, simply use the request property `req.session`,
 which is (generally) serialized as JSON by the store, so nested objects 
 are typically fine. For example below is a user-specific view counter:

      connect(
          connect.cookieParser()
        , connect.session({ secret: 'keyboard cat', cookie: { maxAge: 60000 }})
        , connect.favicon()
        , function(req, res, next){
          var sess = req.session;
          if (sess.views) {
            res.setHeader('Content-Type', 'text/html');
            res.write('<p>views: ' + sess.views + '</p>');
            res.write('<p>expires in: ' + (sess.cookie.maxAge / 1000) + 's</p>');
            res.end();
            sess.views++;
          } else {
            sess.views = 1;
            res.end('welcome to the session demo. refresh!');
          }
        }
      ).listen(3000);

## Session#regenerate()

 To regenerate the session simply invoke the method, once complete
 a new SID and `Session` instance will be initialized at `req.session`.

     req.session.regenerate(function(err){
       // will have a new session here
     });

## Session#destroy()

 Destroys the session, removing `req.session`, will be re-generated next request.

     req.session.destroy(function(err){
       // cannot access session here
     });

## Session#reload()

 Reloads the session data.

     req.session.reload(function(err){
       // session updated
     });

## Session#save()

 Save the session.

     req.session.save(function(err){
       // session saved
     });

## Session#touch()

  Updates the `.maxAge`, and `.lastAccess` properties. Typically this is
  not necessary to call, as the session middleware does this for you.

## Session#cookie

 Each session has a unique cookie object accompany it. This allows
 you to alter the session cookie per visitor. For example we can
 set `req.session.cookie.expires` to `false` to enable the cookie
 to remain for only the duration of the user-agent.

## Session#maxAge

 Alternatively `req.session.cookie.maxAge` will return the time
 remaining in milliseconds, which we may also re-assign a new value
 to adjust the `.expires` property appropriately. The following
 are essentially equivalent

    var hour = 3600000;
    req.session.cookie.expires = new Date(Date.now() + hour);
    req.session.cookie.maxAge = hour;

For example when `maxAge` is set to `60000` (one minute), and 30 seconds
has elapsed it will return `30000` until the current request has completed,
at which time `req.session.touch()` is called to update `req.session.lastAccess`,
and reset `req.session.maxAge` to its original value.

    req.session.cookie.maxAge;
    // => 30000

Session Store Implementation:

Every session store _must_ implement the following methods

   - `.get(sid, callback)`
   - `.set(sid, session, callback)`
   - `.destroy(sid, callback)`

Recommended methods include, but are not limited to:

   - `.length(callback)`
   - `.clear(callback)`

For an example implementation view the [connect-redis](http://github.com/visionmedia/connect-redis) repo.

Static file server with the given `root` path.

Examples:

    var oneDay = 86400000;

    connect(
      connect.static(__dirname + '/public')
    ).listen(3000);

    connect(
      connect.static(__dirname + '/public', { maxAge: oneDay })
    ).listen(3000);

Options:

   - `maxAge`   Browser cache maxAge in milliseconds. defaults to 0
   - `hidden`   Allow transfer of hidden files. defaults to false
   - `redirect`   Redirect to trailing "/" when the pathname is a dir

Setup vhost for the given `hostname` and `server`.

Examples:

    connect(
      connect.vhost('foo.com',
        connect.createServer(...middleware...)
      ),
      connect.vhost('bar.com',
        connect.createServer(...middleware...)
      )
    );

Initialize a new `connect.HTTPServer` with the middleware
passed to this function. When an object is passed _first_,
we assume these are the tls options, and return a `connect.HTTPSServer`.

Examples:

An example HTTP server, accepting several middleware.

    var server = connect.createServer(
        connect.logger()
      , connect.static(__dirname + '/public')
    );

An HTTPS server, utilizing the same middleware as above.

    var server = connect.createServer(
        { key: key, cert: cert }
      , connect.logger()
      , connect.static(__dirname + '/public')
